style.css:
@-moz-document domain("situacao-cadastral.com") {
body {
    background-color: #212529;
    color: #fff;
}

#texto {
    border: 2px solid #515151;
    background-color: #2b3035;
}

input {
    color: #fff;
    background-color: #2b3035;
}

#resultado {
    border: 2px solid #515151;
    background-color: #2b3035;
}

#resultado .documento {
    background-color: #3c91c9;
}

#rodape {
    display: none;
}

#rdlinks {
    display: none;
}

#mensagem {
    background-color: #2b3035;
}
}
